Welcome to YOU App!

The video dating app where you can make new acquaintances, find your love and get a match in a second. Just say "Hi" and it will be more than enough to start an interesting journey with our app.

KEY FEATURES:
- Start a video chat with attractive strangers in a second;
- Filter people by gender in order to find a perfect match;
- Make private video calls with your previous matches;
- Send a photo, gift or text message to your favorites;  
- Auto translation of all messages is free.


PREMIUM FEATURES:
- No Ads in the app: Remove the annoying ads;
- No limits for texts and photo messages;
- Private video calls from your matches;
- View people who Liked You: : Find out who liked you and start a private chat;
- Get a status of Read messages;


HOW IT WORKS:
1) Log in in one click – fast registration;
2) Tell a little bit about yourself;
3) Click “Call” and start your video chat in a second


MAIN RULES:
1) YOU is an 18+ app;
2) Nudity is forbidden;
3) Inappropriate behavior is prohibited;


SUBSCRIPTION SERVICE:
If you choose to purchase YOU Premium and have an access to Premium features, payment will be charged from your iTunes account and will be charged for renewal within 24-hours prior to the end of the current period.

Auto-renewal may be turned off at any time by going to your settings in the iTunes Store after purchase.

YOU Premium subscription price varies between $14,99 and $71,99. All personal data is handled under the terms and conditions of YOU's privacy policy.


